const tintColorLight = '#2f95dc';
const tintColorDark = '#fff';

interface Colors {
  focus: string;
  goodnight: string;
  happiness: string;
  textGray: string;
  titleBlack: string;
}

export const journeyColors: Object = {
  focus: '#002FA7',
  goodnight: '#2A5741',
  happiness: '#E8A455',
  textGray: '#718096',
  titleBlack: '#343A40',
};

export default {
  light: {
    text: '#000',
    background: '#fff',
    tint: tintColorLight,
    tabIconDefault: '#ccc',
    tabIconSelected: tintColorLight,
  },
  dark: {
    text: '#fff',
    background: '#000',
    tint: tintColorDark,
    tabIconDefault: '#ccc',
    tabIconSelected: tintColorDark,
  },
  journeyColors: {
    focus: '#002FA7',
    goodnight: '#2A5741',
    happiness: '#E8A455',
    textGray: '#718096',
    titleBlack: '#343A40',
  },
};
